# ── Defaults (override on the command line) ───────────────────────────────────
PROVIDER     ?= claude
MODEL        ?= claude-opus-4-6
URL          ?=
JUPYTER_PORT ?= 8888

.PHONY: help install start stop cli setup

.DEFAULT_GOAL := help

# ── help ──────────────────────────────────────────────────────────────────────
help:
	@echo ""
	@echo "Usage:"
	@echo "  make install                       Install Python dependencies"
	@echo "  make start                         Start Jupyter Notebook (creates .env if missing)"
	@echo "  make stop                          Stop the Jupyter Notebook server"
	@echo "  make cli URL=https://...           Generate a Python CLI from a docs URL"
	@echo ""
	@echo "Parameters for make cli (with defaults):"
	@echo "  PROVIDER=$(PROVIDER)   claude | hf"
	@echo "  MODEL=$(MODEL)"
	@echo "  URL=$(URL)"
	@echo "  JUPYTER_PORT=$(JUPYTER_PORT)"
	@echo ""
	@echo "Examples:"
	@echo "  make cli URL=https://docs.anthropic.com/en/api/messages"
	@echo "  make cli URL=https://huggingface.co/docs/hub/api PROVIDER=hf MODEL=mistralai/Mistral-7B-Instruct-v0.3"
	@echo ""

# ── install ───────────────────────────────────────────────────────────────────
## Install Python dependencies from requirements.txt
install:
	pip install -r requirements.txt

# ── start ─────────────────────────────────────────────────────────────────────
## Fire up Jupyter Notebook (prompts for API keys when .env is missing).
## Press Ctrl+C or run `make stop` (from another terminal) to shut down.
start: setup
	jupyter notebook notebooks/generate_cli.ipynb --port $(JUPYTER_PORT)

# ── stop ──────────────────────────────────────────────────────────────────────
## Shut down the Jupyter Notebook server.
stop:
	@jupyter notebook stop $(JUPYTER_PORT) 2>/dev/null \
	  && echo "Jupyter stopped on port $(JUPYTER_PORT)." \
	  || { pkill -f "jupyter.*notebook" 2>/dev/null \
	         && echo "Jupyter process killed." \
	         || echo "No Jupyter server found on port $(JUPYTER_PORT)."; }

# ── cli ───────────────────────────────────────────────────────────────────────
## Generate a Python CLI tool from a documentation URL.
## Usage: make cli URL=https://... [PROVIDER=claude|hf] [MODEL=model-name]
cli: setup
ifndef URL
	$(error URL is required. Usage: make cli URL=https://... [PROVIDER=claude|hf] [MODEL=model-name])
endif
	@echo ""
	@echo "Provider : $(PROVIDER)"
	@echo "Model    : $(MODEL)"
	@echo "URL      : $(URL)"
	@echo ""
	@set -a && . ./.env && set +a && \
	  PROVIDER=$(PROVIDER) MODEL=$(MODEL) URL=$(URL) \
	  papermill notebooks/generate_cli.ipynb \
	    /tmp/cli_out_$$(date +%s).ipynb \
	    -p PROVIDER "$(PROVIDER)" \
	    -p MODEL    "$(MODEL)" \
	    -p URL      "$(URL)"

# ── setup (internal) ──────────────────────────────────────────────────────────
## Create .env with API keys. Skipped silently when .env already exists.
setup:
	@chmod +x scripts/setup.sh
	@bash scripts/setup.sh

